import React from 'react'
import Menu from '../Component/Menu';
import footer from '../Img/footer.png'
import alcyone from '../Img/Alcyone.png'
import {
    Link
} from "react-router-dom";


function Recruitment() {
    return (
        <div >
            <Menu />
            <div style={{ backgroundColor: '#440BD4', marginRight: "2%", marginTop: '1%', textAlign: 'center', borderRadius: 5, color: 'white', fontWeight: 'bold',width:'20%',height:'20%' }}>
            <div>ALC</div> 
            <img style={{ width: '100%',height:'250px' }} src={alcyone} alt="alcyone" />
               <div>RANK</div> 
               <div>ALC</div> 
            </div>
            <img style={{ width: '100%' }} src={footer} alt="footer" />
        </div>
    );
}

export default Recruitment;
